for book in original_graph.subjects(predicate=rdflib.RDF.type, object=rdflib.URIRef('http://schema.org/Book')):
    # Get the constellation link of the book
    constellationLink = original_graph.value(subject=book, predicate=rdflib.URIRef('http://www.example.org/pbs/#constellationLink'))
    # Find the corresponding isbn using the dictionary
    isbn = constellation_to_isbn.get(str(constellationLink))
